import React from 'react';
import {Col, Row} from "react-bootstrap";
import styles from "../ProfileInfo.module.css";


const ProfileInfo = () => {
    return (
        <Col xs='12'>
            <Col xs='12'>
                <img className={styles.wallper} src='london.jpg'></img>
            </Col>
            <Col xs='12'>ava+description</Col>
            <Col xs='12'>my/new posts</Col>
        </Col>

);
}
export default  ProfileInfo
